import { react } from "react";
import {Container, Row, Col, Image} from "react-bootstrap"




const Profile = (user) => {

    return (
        <Container>



        <ul>
          {user.map(item => (
            <li key={item.objectID}>
              <a href={item.url}>{item.title}</a>
            </li>
          ))}
        </ul>
      </Container>
      );


}

export default Profile
